import{_ as e,o as a,c as i,O as t}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 54.1-3442.5 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3442.5.md","filePath":"vacode/54.1-3442.5.md"}'),r={name:"vacode/54.1-3442.5.md"},n=t('<h1 id="§-54-1-3442-5-definitions" tabindex="-1">§ 54.1-3442.5 Definitions. <a class="header-anchor" href="#§-54-1-3442-5-definitions" aria-label="Permalink to &quot;§ 54.1-3442.5 Definitions.&quot;">​</a></h1><p>As used in this article:</p><p>&quot;Botanical cannabis,&quot;&quot;cannabis oil,&quot;&quot;cannabis product,&quot; and &quot;usable cannabis&quot; have the same meanings as specified in § <a href="/vacode/54.1-3408.3/">54.1-3408.3</a>.</p><p>&quot;Cannabis dispensing facility&quot; means a facility that (i) has obtained a permit from the Board pursuant to § <a href="/vacode/54.1-3442.6/">54.1-3442.6</a>; (ii) is owned, at least in part, by a pharmaceutical processor; and (iii) dispenses cannabis products produced by a pharmaceutical processor to a patient, his registered agent, or, if such patient is a minor or a vulnerable adult as defined in § <a href="/vacode/18.2-369/">18.2-369</a>, such patient&#39;s parent or legal guardian.</p><p>&quot;Designated caregiver facility&quot; has the same meaning as defined in § <a href="/vacode/54.1-3408.3/">54.1-3408.3</a>.</p><p>&quot;Pharmaceutical processor&quot; means a facility that (i) has obtained a permit from the Board pursuant to § <a href="/vacode/54.1-3408.3/">54.1-3408.3</a> and (ii) cultivates Cannabis plants intended only for the production of cannabis oil, botanical cannabis, and usable cannabis, produces cannabis products, and dispenses cannabis products to a patient pursuant to a written certification, his registered agent, or, if such patient is a minor or a vulnerable adult as defined in § <a href="/vacode/18.2-369/">18.2-369</a>, such patient&#39;s parent or legal guardian.</p><p>&quot;Practitioner&quot; has the same meaning as specified in § <a href="/vacode/54.1-3408.3/">54.1-3408.3</a>.</p><p>&quot;Registered agent&quot; has the same meaning as specified in § <a href="/vacode/54.1-3408.3/">54.1-3408.3</a>.</p><p>2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0613" target="_blank" rel="noreferrer">613</a>; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0246" target="_blank" rel="noreferrer">246</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0809" target="_blank" rel="noreferrer">809</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0690" target="_blank" rel="noreferrer">690</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1278" target="_blank" rel="noreferrer">1278</a>; 2021, Sp. Sess. I, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0205" target="_blank" rel="noreferrer">205</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0227" target="_blank" rel="noreferrer">227</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0228" target="_blank" rel="noreferrer">228</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0259" target="_blank" rel="noreferrer">259</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0391" target="_blank" rel="noreferrer">391</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0392" target="_blank" rel="noreferrer">392</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0642" target="_blank" rel="noreferrer">642</a>.</p>',9),o=[n];function s(l,c,p,g,f,d){return a(),i("div",null,o)}const b=e(r,[["render",s]]);export{u as __pageData,b as default};
